<template>
  <div>
    <v-btn @click="get_icon()">base_64_test</v-btn>
    <v-avatar id="main"></v-avatar>
  </div>
</template>

<script>
export default {
  components: {
  },
  data() {
    return {
      test_value: null,
    };
  },
  methods: {
    // アバターに表示するアイコン画像を取得する
    // TODO : ログイン成功の際に実行できるようにしたい
    get_icon() {
      function Base64ToImage(base64img, callback) {
        var img = new Image();
        img.onload = function () {
          callback(img);
        };
        img.src = base64img;
      }

      // TODO : APIを叩いて，base64を要求する機能を実装する

      // base64にエンコードされた画像を保持する
      // ここにbase64を持たせてset_iconを実行すれば，アバターが表示される
      var base64img =
        "data:image/jpeg;base64,";

      Base64ToImage(base64img, function (img) {
        document.getElementById("main").appendChild(img);
      });
    },
  },
};
</script>
